import React, { useEffect } from "react";
import PropTypes from "prop-types";
import { acGetItemPoll } from "../../redux/action";
import { connect } from "react-redux";

Edit.propTypes = {};

function Edit(props) {
  useEffect(() => {
    console.log(props.match.match.params.id);
    // props.getItemPoll();
  }, []);
  return (
    <div>
      <p>What need to be poll ? </p>
      <div>
        <input placeholder="Add option"></input>
        <button>Add</button>
        <div></div>
      </div>
    </div>
  );
}

// const mapStateToProps = () => {

// }

const mapDispatchToProps = (dispatch) => {
  return {
    getItemPoll: () => {
      return dispatch(acGetItemPoll());
    },
  };
};

export default connect(null, mapDispatchToProps)(Edit);
